def count_substring_occurrences(n, strings, queries):
    from collections import defaultdict

    def binary_search(temp, i, j, k):
        if k < temp[i]:
            return i - 1
        while j - i > 1:
            mid = (i + j) // 2
            if temp[mid] < k:
                i = mid
            elif temp[mid] > k:
                j = mid - 1
            else:
                j = mid - 1
        if temp[j] < k:
            return j
        if temp[i] < k:
            return i
        return i - 1
    d = defaultdict(list)
    for (idx, s) in enumerate(strings):
        length = len(s)
        check = set()
        for j in range(length):
            for k in range(j + 1, length + 1):
                temp = s[j:k]
                if temp not in check:
                    d[temp].append(idx)
                    check.add(temp)
    results = []
    for (L, R, s) in queries:
        L = int(L) - 1
        R = int(R) - 1
        if s not in d:
            results.append(0)
        else:
            temp = d[s]
            length = len(temp)
            left = binary_search(temp, 0, length - 1, L)
            right = binary_search(temp, 0, length - 1, R + 1)
            results.append(right - left)
    return results

